import numpy as np

def submatrix_with_n_numbers(matrix):
    count = 0
    rows, cols = matrix.shape
    for i in range(rows): 
        for j in range(cols): 
            for r in range(i+1, rows+1): 
                for c in range(j+1, cols+1): 
                    if len(matrix[i:r,j:c].flatten()) == 37:
                        count += 1
    return count
```
This code searches for all possible submatrices in the given matrix using nested loops. It flattens the submatrix to a 1D array and checks its size. If the size is 37, it increments the count. Finally, it returns the count.
